// src/components/Navbar.js
import React, { useEffect, useState } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Box,
  Button,
  Badge,
  Paper,
} from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import IcecreamIcon from "@mui/icons-material/Icecream";
import { Link, useNavigate } from "react-router-dom";
import { getCart } from "../api/cart";

export default function Navbar({ currentUser, onLogout }) {
  const [count, setCount] = useState(0);
  const navigate = useNavigate();

  // Fetch cart count
  useEffect(() => {
    if (!currentUser || currentUser.role === "ADMIN") {
      setCount(0);
      return;
    }

    getCart(currentUser.username)
      .then((res) => {
        const items = res.data || [];
        const total = items.reduce((s, it) => s + (it.quantity || 1), 0);
        setCount(total);
      })
      .catch(() => setCount(0));
  }, [currentUser]);

  return (
    <Paper
      elevation={4}
      sx={{
        position: "sticky",
        top: 0,
        zIndex: 1000,
        background: "linear-gradient(90deg, #ffe3ee, #ffd7e8)",
        borderBottom: "1px solid #ffc9dd",
        borderRadius: "0 0 18px 18px",
      }}
    >
      <AppBar
        elevation={0}
        position="static"
        sx={{
          background: "transparent",
        }}
      >
        <Toolbar sx={{ display: "flex", justifyContent: "space-between" }}>
          
          {/* Logo */}
          <Box
            display="flex"
            alignItems="center"
            component={Link}
            to="/"
            sx={{ textDecoration: "none" }}
          >
            <IcecreamIcon sx={{ color: "#ff4f7b", mr: 1 }} />
            <Typography
              variant="h5"
              sx={{ color: "#d6246c", fontWeight: "800", letterSpacing: 1 }}
            >
              SweetCraft
            </Typography>
          </Box>

          {/* Middle menu */}
          <Box>
            <Button component={Link} to="/" sx={{ color: "#a12456", mx: 1 }}>
              Home
            </Button>
            <Button component={Link} to="/categories" sx={{ color: "#a12456", mx: 1 }}>
              Categories
            </Button>

            {currentUser?.role !== "ADMIN" && (
              <Button component={Link} to="/orders" sx={{ color: "#a12456", mx: 1 }}>
                My Orders
              </Button>
            )}

            {currentUser?.role === "ADMIN" && (
              <Button
                component={Link}
                to="/admin"
                sx={{
                  color: "#a12456",
                  mx: 1,
                  fontWeight: "bold",
                }}
              >
                Admin
              </Button>
            )}
          </Box>

          {/* Right side */}
          <Box display="flex" alignItems="center">
            {!currentUser ? (
              <>
                <Button onClick={() => navigate("/login")} sx={{ color: "#a12456" }}>
                  Login
                </Button>
                <Button onClick={() => navigate("/register")} sx={{ color: "#a12456" }}>
                  Register
                </Button>
              </>
            ) : (
              <>
                <Typography sx={{ mr: 2, fontWeight: "bold", color: "#7d254a" }}>
                  {currentUser.username}
                </Typography>
                <Button onClick={onLogout} sx={{ color: "#a12456" }}>
                  Logout
                </Button>
              </>
            )}

            {/* Cart */}
            {currentUser?.role !== "ADMIN" && (
              <IconButton onClick={() => navigate("/cart")} sx={{ color: "#ff4f7b" }}>
                <Badge
                  badgeContent={count}
                  sx={{
                    "& .MuiBadge-badge": {
                      backgroundColor: "#ff4f7b",
                      color: "white",
                    },
                  }}
                >
                  <ShoppingCartIcon />
                </Badge>
              </IconButton>
            )}
          </Box>
        </Toolbar>
      </AppBar>
    </Paper>
  );
}
